import { Fragment } from "react";
import Header from "./Components/Layout/Header";
import Meals from "./Components/Meals/Meals";
import Modal from "./Components/UI/Modal";
import Card from "./Components/UI/Card";

function App() {
  return (
    <Fragment>
      <Card />
      <Header />
      <main>
        <Meals />
      </main>
    </Fragment>
  );
}

export default App;
